import Bar from "../../components/bar";
import { Container } from "./styles";
import Buttons from "../../components/button";

const Home = () => {
  return (
    <>
      <Bar />
      <Container>
        <div className="background"></div>
        <div className="buttons">
          <Buttons></Buttons>
          <span>ou</span>
          <Buttons></Buttons>
        </div>
      </Container>
    </>
  );
};

export default Home;
